import React from "react";

function Header() {
  return (
    <header className="header">
        <a></a>
        <img src="http://www.octoconsulting.com/wp-content/themes/octo-theme/images/Octo_logo.png"/>
        <h1>DQ Automation Tool</h1>
    </header>
  );
}

export default Header;
